import React, { createContext, useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// --- Components (simples exemplos inline) ---
function Navbar() {
  return (
    <nav style={{ padding: '1rem', background: '#eee' }}>
      <a href="/">Home</a> | <a href="/login">Login</a> | <a href="/register">Register</a>
    </nav>
  );
}

function Footer() {
  return (
    <footer style={{ padding: '1rem', background: '#eee', marginTop: '2rem', textAlign: 'center' }}>
      © 2025 Meu Projeto
    </footer>
  );
}

function Home() {
  return <h2>Página Home</h2>;
}

function Login() {
  return <h2>Página Login</h2>;
}

function Register() {
  return <h2>Página Register</h2>;
}

// --- Contexts ---
export const AuthContext = createContext();
export const UserContext = createContext();
export const PetContext = createContext();

function App() {
  const [auth, setAuth] = useState({ loggedIn: false, user: null });
  const [user, setUser] = useState({ name: 'Bruno', email: 'bruno@email.com' });
  const [pets, setPets] = useState([{ id: 1, name: 'Rex' }, { id: 2, name: 'Mimi' }]);

  return (
    <AuthContext.Provider value={{ auth, setAuth }}>
      <UserContext.Provider value={{ user, setUser }}>
        <PetContext.Provider value={{ pets, setPets }}>
          <Router>
            <Navbar />
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
            </Routes>
            <Footer />
          </Router>
        </PetContext.Provider>
      </UserContext.Provider>
    </AuthContext.Provider>
  );
}

export default App;
